					Does not affect course content access, see access_opens_date to control course access start date.
					Format: Y-m-d H:i:s.'=>['urls'=>[],'names'=>[],'cmp'=>['lifterlms',1]],'Message displayed to visitors when attempting to enroll into a course before the enrollment_opens_date has passed.'=>['urls'=>[],'names'=>[],'cmp'=>['lifterlms',1]],'Enrollment in this course opens on [lifterlms_course_info id="{{course_id}}" key="enrollment_start_date"].'=>['urls'=>[],'names'=>[],'cmp'=>['lifterlms',1]],'The WordPress page ID of the sales page. Required when sales_page_type equals page. Only returned when the sales_page_type equals page.'=>['urls'=>[],'names'=>[],'cmp'=>['lifterlms',1]],'Determines the type of sales page content to display.<br> - <code>none</code> displays the course content.<br> - <code>content</code> displays alternate content from the <code>excerpt</code> property.<br> - <code>page</code> redirects to the WordPress page defined in <code>content_page_id</code>.<br> - <code>url</code> redirects to the URL defined in <code>content_page_url</code>'=>['urls'=>[],'names'=>[],'cmp'=>['lifterlms',1]],'Display default course content'=>['urls'=>[],'names'=>[],'cmp'=>['lifterlms',1]],'Show custom content'=>['urls'=>[],'names'=>[],'cmp'=>['lifterlms',1]],'Redirect to WordPress Page'=>['urls'=>[],'names'=>[],'cmp'=>['lifterlms',1]],'Redirect to custom URL'=>['urls'=>[],'names'=>[],'cmp'=>['lifterlms',1]],'The URL of the sales page content. Required when <code>content_type</code> equals <code>url</code>. Only returned when the <code>content_type</code> equals <code>url</code>.'=>['urls'=>[],'names'=>[],'cmp'=>['lifterlms',1]],'When true the video_embed will be used on the course tiles (on the catalog, for example) instead of the featured image.'=>['urls'=>[],'names'=>[],'cmp'=>['lifterlms',1]],'Limit result set to posts assigned one or more statuses.'=>['urls'=>[],'names'=>[],'cmp'=>['lifterlms',1]],'Post password. Required if the post is password protected.'=>['urls'=>[],'names'=>[],'cmp'=>['lifterlms',1]],'Bypass the trash and force course deletion.'=>['urls'=>[],'names'=>[],'cmp'=>['lifterlms',1]],'Unique Course Identifier. The WordPress Post ID'=>['urls'=>[],'names'=>[],'cmp'=>['lifterlms',1]],'WordPress post ID of the parent item. Must be a Section ID. 0 indicates an "orphaned" lesson which can be edited and viewed by instructors and admins but cannot be read by students.'=>['urls'=>[],'names'=>[],'cmp'=>['lifterlms',1]],'WordPress post ID of the lesson\'s parent course.'=>['urls'=>[],'names'=>[],'cmp'=>['lifterlms',1]],'Order of the lesson within its immediate parent.'=>['urls'=>[],'names'=>[],'cmp'=>['lifterlms',1]],'Lesson ID of the prerequisite lesson.'=>['urls'=>[],'names'=>[],'cmp'=>['lifterlms',1]],'Determines the weight of the lesson when grading the course.'=>['urls'=>[],'names'=>[],'cmp'=>['lifterlms',1]],'The date and time when the lesson becomes available. Applicable only when drip_method is date. Format: Y-m-d H:i:s.'=>['urls'=>[],'names'=>[],'cmp'=>['lifterlms',1]],'Number of days to wait before allowing access to the lesson. Applicable only when drip_method is enrollment, start, or prerequisite.'=>['urls'=>[],'names'=>[],'cmp'=>['lifterlms',1]],'Determine the method with which to make the lesson content available.
					<ul>
						<li>none: Drip is disabled; the lesson is immediately available.</li>
						<li>date: Lesson is made available at a specific date and time.</li>
						<li>enrollment: Lesson is made available a specific number of days after enrollment into the course.</li>
						<li>start: Lesson is made available a specific number of days after the course\'s start date. Only available on courses with a access_opens_date.</li>
						<li>prerequisite: Lesson is made available a specific number of days after the prerequisite lesson is completed.</li>
					</ul>'=>['urls'=>[],'names'=>[],'cmp'=>['lifterlms',1]],'Denotes a lesson that\'s publicly accessible regardless of course enrollment.'=>['urls'=>[],'names'=>[],'cmp'=>['lifterlms',1]],'Associate a quiz with this lesson.'=>['urls'=>[],'names'=>[],'cmp'=>['lifterlms',1]],'Determines if a quiz is enabled for the lesson.'=>['urls'=>[],'names'=>[],'cmp'=>['lifterlms',1]],'The post ID of the associated quiz.'=>['urls'=>[],'names'=>[],'cmp'=>['lifterlms',1]],'Determines lesson progression requirements related to the quiz.
